import React from 'react';
import styles from './TeamLineupOverlay.module.css';

const roleSvgs = {
  TOP: (
    <svg width="16" height="16" viewBox="0 0 24 24" fill="none"><circle cx="12" cy="12" r="10" stroke="#00eaff" strokeWidth="2"/><path d="M12 6v6l4 2" stroke="#00eaff" strokeWidth="2" strokeLinecap="round"/></svg>
  ),
  JNG: (
    <svg width="16" height="16" viewBox="0 0 24 24" fill="none"><rect x="4" y="4" width="16" height="16" rx="8" stroke="#00eaff" strokeWidth="2"/><path d="M12 8v4l3 3" stroke="#00eaff" strokeWidth="2" strokeLinecap="round"/></svg>
  ),
  MID: (
    <svg width="16" height="16" viewBox="0 0 24 24" fill="none"><ellipse cx="12" cy="12" rx="10" ry="6" stroke="#00eaff" strokeWidth="2"/><path d="M12 6v12" stroke="#00eaff" strokeWidth="2" strokeLinecap="round"/></svg>
  ),
  ADC: (
    <svg width="16" height="16" viewBox="0 0 24 24" fill="none"><rect x="4" y="8" width="16" height="8" rx="4" stroke="#00eaff" strokeWidth="2"/><path d="M8 12h8" stroke="#00eaff" strokeWidth="2" strokeLinecap="round"/></svg>
  ),
  SUP: (
    <svg width="16" height="16" viewBox="0 0 24 24" fill="none"><circle cx="12" cy="12" r="10" stroke="#00eaff" strokeWidth="2"/><path d="M8 16c0-2.21 1.79-4 4-4s4 1.79 4 4" stroke="#00eaff" strokeWidth="2" strokeLinecap="round"/></svg>
  ),
};

const TeamLineupOverlay = () => {
  // Data for both teams
  const matchData = {
    championship: "WORLD CHAMPIONSHIP",
    location: "LONDON", 
    stage: "SEMIFINALS",
    matchInfo: "BEST OF 5",
    teams: {
      afk: {
        teamName: "AFK",
        region: "LCK#2",
        logo: "https://via.placeholder.com/80x80/ff6b6b/ffffff?text=AFK",
        players: [
          {
            name: "Kiin",
            role: "TOP",
            image: "https://via.placeholder.com/140x160/4a90e2/ffffff?text=Kiin"
          },
          {
            name: "Peanut", 
            role: "JNG",
            image: "https://via.placeholder.com/140x160/4a90e2/ffffff?text=Peanut"
          },
          {
            name: "Chovy",
            role: "MID", 
            image: "https://via.placeholder.com/140x160/4a90e2/ffffff?text=Chovy"
          },
          {
            name: "Deft",
            role: "ADC",
            image: "https://via.placeholder.com/140x160/4a90e2/ffffff?text=Deft"
          },
          {
            name: "Lehends",
            role: "SUP",
            image: "https://via.placeholder.com/140x160/4a90e2/ffffff?text=Lehends"
          }
        ]
      },
      uw3: {
        teamName: "UW3",
        region: "LPL#1",
        logo: "https://via.placeholder.com/80x80/4ecdc4/ffffff?text=UW3",
        players: [
          {
            name: "Bin",
            role: "TOP",
            image: "https://via.placeholder.com/140x160/4a90e2/ffffff?text=Bin"
          },
          {
            name: "Kanavi", 
            role: "JNG",
            image: "https://via.placeholder.com/140x160/4a90e2/ffffff?text=Kanavi"
          },
          {
            name: "Knight",
            role: "MID", 
            image: "https://via.placeholder.com/140x160/4a90e2/ffffff?text=Knight"
          },
          {
            name: "Ruler",
            role: "ADC",
            image: "https://via.placeholder.com/140x160/4a90e2/ffffff?text=Ruler"
          },
          {
            name: "Missing",
            role: "SUP",
            image: "https://via.placeholder.com/140x160/4a90e2/ffffff?text=Missing"
          }
        ]
      }
    },
    matchHistory: [
      { stage: "SWISS STAGE", round: "R1", opponent: "TES", result: "W" },
      { stage: "SWISS STAGE", round: "R2", opponent: "PNG", result: "W" },
      { stage: "SWISS STAGE", round: "R3", opponent: "BLG", result: "W" },
      { stage: "QUARTERFINALS", round: "", opponent: "GEN", result: "W", score: "3:1" },
      { stage: "SEMIFINALS", round: "", opponent: "T1", result: "TBD", score: "" }
    ]
  };

  const renderTeam = (team) => (
    <div className={styles.teamSection}>
      <div className={styles.teamInfo}>
        <div className={styles.teamLogo}>
          <img src={team.logo} alt={team.teamName} />
        </div>
        <div className={styles.teamName}>{team.teamName}</div>
        <div className={styles.teamRegion}>{team.region}</div>
      </div>

      <div className={styles.players}>
        {team.players.map((player, index) => (
          <div key={index} className={styles.playerCard}>
            <div className={styles.playerRoleIcon}>
              {roleSvgs[player.role]}
            </div>
            <div className={styles.playerName}>{player.name}</div>
            <div className={styles.playerImage}>
              <img src={player.image} alt={player.name} />
            </div>
          </div>
        ))}
      </div>
    </div>
  );

  return (
    <div className={styles.overlay}>
      <div className={styles.background}>
        {/* Header section */}
        <div className={styles.header}>
          <div className={styles.championship}>
            <div className={styles.championshipText}>{matchData.championship}</div>
            <div className={styles.locationText}>{matchData.location}</div>
            <div className={styles.stageText}>{matchData.stage}</div>
          </div>

          <div className={styles.vsSection}>
            <div className={styles.vsText}>VS</div>
            <div className={styles.matchInfo}>{matchData.matchInfo}</div>
          </div>

          <div className={styles.leagueLogo}>
            <div className={styles.leagueText}>LEAGUE<span className={styles.ofText}>OF</span></div>
            <div className={styles.legendsText}>LEGENDS</div>
          </div>
        </div>

        {/* Teams container */}
        <div className={styles.teamsContainer}>
          {renderTeam(matchData.teams.afk)}
          {renderTeam(matchData.teams.uw3)}
        </div>

        {/* Tournament progression section */}
        <div className={styles.tournament}>
          {matchData.matchHistory.map((match, index) => (
            <div key={index} className={styles.matchHistoryItem}>
              <div className={styles.stageName}>{match.stage}</div>
              <div className={styles.matchDetails}>
                {match.round && <span className={styles.round}>{match.round}</span>}
                <span className={styles.vsTextSmall}>VS {match.opponent}</span>
                {match.score && <span className={styles.score}>{match.score}</span>}
              </div>
            </div>
          ))}
        </div>

        {/* Decorative frame elements */}
        <div className={styles.frameTopLeft}></div>
        <div className={styles.frameTopRight}></div>
        <div className={styles.frameBottomLeft}></div>
        <div className={styles.frameBottomRight}></div>
        <div className={styles.gridLines}></div>
      </div>
    </div>
  );
};

export default TeamLineupOverlay;
